import { useState } from "react";
import "./App.css"
 
function StudentForm(){
    const[id,SetId]=useState("")
    const[Name,SetName]=useState("")
    const[City,SetCity]=useState("")
    const[RollNO,SetRollNo]=useState("")
    const[Mobile,SetMobile]=useState("")
    const[Course,SetCourse]=useState("")
    const[DOJ,SetDOJ]=useState("")

    return(
        <div classNameName="container w-28">
            <div classNameName="card">
                <div classNameName="card-title">
                    <h>Student Form</h>
                </div>
                <div classNameName="card-body"> 
                <form>
  <div className="mb-3">
    <label classNameName="form-label">ID</label>
    <input type="email" className="form-control" value={id} placeholder="Enter ID"  disabled/>
  </div>
  <div className="mb-3">
    <label className="form-label">Name</label>
    <input type="password" className="form-control" value={Name} placeholder="Enter Name" required/>
  </div>
  
  <button type="submit" className="btn btn-primary">Submit</button>
</form>
                </div>
            </div>
        </div>
       
    )
}
export default StudentForm;
